export default function tabs(){var t=document.querySelectorAll(".default_tab");let a=document.querySelectorAll(".block_tab");t.forEach((t,e)=>{t.addEventListener("click",()=>{document.querySelector(".default_tab-active")?.classList.remove("default_tab-active"),document.querySelector(".block_tab-active")?.classList.remove("block_tab-active"),t.classList.add("default_tab-active"),a[e].classList.add("block_tab-active")})})}